DROP TABLE IF EXISTS `products`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `products` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(150) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `description` text CHARACTER SET utf8 COLLATE utf8_unicode_ci,
  `price` decimal(11,2) DEFAULT NULL,
  `catalog_id` int unsigned NOT NULL,
  `category_id` int unsigned NOT NULL,
  `media_id` int unsigned DEFAULT NULL,
  `manufacture_id` int unsigned DEFAULT NULL,
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP,
  `update_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `index_of_media_id` (`media_id`),
  KEY `index_of_manufacture_id` (`manufacture_id`),
  KEY `products_catalog_id_fk` (`catalog_id`),
  KEY `products_category_id_fk` (`category_id`),
  KEY `products_name_price_idx` (`price`,`name`),
  CONSTRAINT `products_catalog_id_fk` FOREIGN KEY (`catalog_id`) REFERENCES `catalogs` (`id`) ON DELETE RESTRICT,
  CONSTRAINT `products_category_id_fk` FOREIGN KEY (`category_id`) REFERENCES `categories` (`id`) ON DELETE RESTRICT,
  CONSTRAINT `products_manufacture_id_fk` FOREIGN KEY (`manufacture_id`) REFERENCES `manufacturer` (`id`) ON DELETE SET NULL,
  CONSTRAINT `products_media_id_fk` FOREIGN KEY (`media_id`) REFERENCES `media` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB AUTO_INCREMENT=153 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

